// src/components/Navbar.js
import React from 'react';
import { Navbar, Nav, Form, Button } from 'react-bootstrap';
import './Navbar.css'; // Ensure you create this CSS file for styling

const CustomNavbar = () => {
    const handleSearch = (event) => {
        event.preventDefault();
        // Implement search functionality here
        const query = event.target.elements.search.value;
        console.log("Searching for:", query);
    };

    return (
        <Navbar bg="light" expand="lg" className="p-3">
            <Navbar.Brand href="#home">
                <img
                    src="https://via.placeholder.com/150" // Replace with your logo URL
                    width="50"
                    height="50"
                    alt="Logo"
                />
            </Navbar.Brand>
            <Form inline onSubmit={handleSearch} className="mx-auto">
                <Form.Control
                    type="search"
                    placeholder="Search..."
                    name="search"
                    className="mr-2"
                />
                <Button variant="outline-secondary" type="submit">
                    <i className="fas fa-microphone"></i> {/* Microphone icon */}
                </Button>
            </Form>
            <Nav className="ml-auto">
                <Nav.Link href="#login">Login</Nav.Link>
                <Nav.Link href="#cart">Cart</Nav.Link>
            </Nav>
        </Navbar>
    );
};

export default CustomNavbar;
